package xiaofan.zhang.demo;

import org.apache.commons.collections.map.HashedMap;

import java.util.HashMap;
import java.util.Map;

/**
 * Created by zhangxiaofan on 2019/6/8.
 */
public class demo9 {
    public static void main(String[] args) {
        demo9 demo9 = new demo9();
        String s = "aacc";
        String t = "aaac";
        s = "";
        t = "";
        boolean anagram = demo9.isAnagram1(s, t);
        System.out.println(anagram);
    }

    public boolean isAnagram1(String s, String t) {
        int[] has =new int[26];
        for(int i=0;i<s.length();i++){
            has[s.charAt(i)-'a']++;
            has[t.charAt(i)-'a']--;
        }
        for (int i = 0; i <has.length ; i++) {
            System.out.println(has[i]);
            if(has[i]!=0){
                return false;
            }
        }
        return true;
    }

    public boolean isAnagram(String s, String t) {
        Map<Character,Integer> map1 = new HashMap<>();
        Map<Character,Integer> map2 = new HashMap<>();
        if(s.length()==t.length()){
            for(int i=0;i<s.length();i++){
                map1.put(s.charAt(i),map1.getOrDefault(s.charAt(i),1)+1);
                map2.put(t.charAt(i),map2.getOrDefault(t.charAt(i),1)+1);
            }
            if(map1.equals(map2)){
                for(Map.Entry<Character, Integer> entry :map1.entrySet()){
                    if(map2.get(entry.getKey()).intValue()!=entry.getValue().intValue()){
                        System.out.println(map2.get(entry.getKey())+" ============== "+entry.getValue());
                        return false;
                    }
                }
            }else{
                System.out.println("==============");
                return false;
            }
            return true;
        }
        return false;
    }
}
